import React from 'react';
import { useHistory } from 'react-router-dom';

const Unlog = () => {
    const history = useHistory();

    const handleUnlog = () => {
        localStorage.removeItem('token');
        history.push('/login');
    };

    return (
        <button onClick={handleUnlog} className="bg-teal hover:bg-hoverGray text-white font-bold py-2 px-4 rounded">
            Unlog
        </button>
    );
};

export default Unlog;
